    # Print the sentence
    sentence = ""
    for i in range(N):
        sentence += words[i]
        if words[i] == "$":
            sentence += " " + name_number(sum([num_letters(word) for word in words]))
        if i < N - 1:
            sentence += " "
    print(sentence)

