    # Calculate the number of letters
    number_of_letters = 0
    for i in range(N):
        if i != position:
            number_of_letters += len(words[i])

    # Write the output
    for i in range(N):
        if i == position:
            print(name(number_of_letters), end="")
        else:
            print(words[i], end="")
    print()

